import PropTypes from "prop-types";
import styles from "./Button.module.css";

function Button({ text }) {
  return <button className="{styles.btn}">{text}</button>;
}
//6분부터
Button.prototype = {
  text: PropTypes.string.isRequired,
};
export default Button;
